import React from 'react';
import { useNavigate } from 'react-router-dom';

const MainPage = () => {
  const navigate = useNavigate();

  // Navigate to Admin Login Page
  const handleAdminLogin = () => {
    navigate('/admin/login');
  };

  // Navigate to Employee Login Page
  const handleEmployeeLogin = () => {
    navigate('/employee/login');
  };

  // Navigate to Trainer Login Page
  const handleTrainerLogin = () => {
    navigate('/trainer/login');
  };

  return (
    <div>
      <h1>Automated Question Builder</h1>
      <button onClick={handleAdminLogin}>Admin Login</button>
      <button onClick={handleEmployeeLogin}>Employee Login</button>
      <button onClick={handleTrainerLogin}>Trainer Login</button>
    </div>
  );
};

export default MainPage;
